export enum HairElement {
    BehindHead, BehindEars, CoveringEars
}

class HairItem {

    id: HairType;
    name: string;
    frontSvg: string;
    inFrontOfEars: boolean;
    backSvg?: string;

    constructor(id: HairType, name: string, frontSvg: string, inFrontOfEars: boolean = false, backSvg?: string) {
        this.id = id;
        this.name = name;
        this.frontSvg = frontSvg;
        this.inFrontOfEars = inFrontOfEars;
        this.backSvg = backSvg;
    }
}


class HairCatalog {

    private static _instance: HairCatalog;

    items = [
        new HairItem(HairType.Bald, "Bald", ""),
        new HairItem(HairType.BowlCutHair, "Bowl Cut", BowlCutHair),
        new HairItem(HairType.StylishHair, "Stylish Short", StylishShortHair),
        new HairItem(HairType.SidePart, "Side Part", SidePart),
        new HairItem(HairType.ShortAfro, "Short Curly", ShortAfro),
        new HairItem(HairType.Balding, "Balding", BaldingHair),
        new HairItem(HairType.DeLeve, "DeLeve", DeLeveHair),
        new HairItem(HairType.LongHair1, "Long Curly Hair", LongHair1Front, true, LongHair1Back),
    ];

//    swatches = [
//        new Swatch(HairType.Bald, "Bald", (token) => HairCatalog.decorateSwatch("", token)),
//        new Swatch(HairType.BowlCutHair, "Bowl Cut", (token) => HairCatalog.decorateSwatch(BowlCutHair, token)),
//        new Swatch(HairType.StylishHair, "Stylish Short", (token) => HairCatalog.decorateSwatch(StylishShortHair, token)),
//        new Swatch(HairType.SidePart, "Side Part", (token) => HairCatalog.decorateSwatch(SidePart, token)),
//        new Swatch(HairType.ShortAfro, "Short Curly", (token) => HairCatalog.decorateSwatch(ShortAfro, token)),
//        new Swatch(HairType.Balding, "Balding", (token) => HairCatalog.decorateSwatch(BaldingHair, token)),
//        new Swatch(HairType.DeLeve, "Shaved", (token) => HairCatalog.decorateSwatch(DeLeveHair, token)),
//        new Swatch(HairType.StyledCurly, "Styled Curly", (token) => HairCatalog.decorateSwatch(CurlyHair, token)),
//    ];

    public static get instance() {
        if (HairCatalog._instance == null) {
            HairCatalog._instance = new HairCatalog();
        }
        return HairCatalog._instance;
    }

    getHair(token: Token, element: HairElement) {
        let hair = this.items.filter(i => i.id === token.hairType)[0];

        if (element === HairElement.BehindEars && !hair.inFrontOfEars) {
            return hair.frontSvg.replace("#383838", token.hairColor);
        } else if (element === HairElement.CoveringEars && hair.inFrontOfEars) {
            return hair.frontSvg.replace("#383838", token.hairColor);
        } else if (element === HairElement.BehindHead && hair.backSvg) {
            return hair.backSvg.replace("#383838", token.hairColor);
        } else {
            return "";
        }
    }

    getSwatches(token: Token) {
        if (token.species === Species.Deltan) {
            const bald = this.items[0];
            return [  new Swatch(bald.id, bald.name, (token) => HairCatalog.decorateSwatch(bald, token)) ];
        } else {
            return this.items.map(i => new Swatch(i.id, i.name, (token) => HairCatalog.decorateSwatch(i, token)));
        }
    }

    private static decorateSwatch(hair: HairItem, token: Token) {
        let result = `<svg viewBox="0 0 280 280" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <defs>
                    <clipPath id="hairClipPath` + hair.id + `">
                        <circle cx="140" cy="140" r="140" fill="#ffffff" />
                    </clipPath>
                </defs>
                <g clip-path="url(#hairClipPath` + hair.id + `">
                    <g transform="translate(-130, 10)">`
                        + (hair.backSvg?.replace("#383838", token.hairColor) ?? "")
                        + ReferenceHead.replace(SpeciesOptions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor)
                        + hair.frontSvg.replace("#383838", token.hairColor)
                +  `</g>
                </g>
            </svg>`;
        return result;
    }
}

export default HairCatalog;